import React from 'react';
import './App.css';

import productsData from "./vsschoolProducts.js"
import Product from "./Product.js"

function App() {

  let Products = productsData.map(d => {
  	console.log(d)
  	return <Product
    key = {d.id}
    name = {d.name}
    description = {d.description}
    price = {d.price}
  	/>
  })

  return (
    <div>
      {Products}
    </div>
  );
}

export default App;
